    skip1 = []
    skip2 = []
    for a_elem in a:
        for i in range(len(skip2)):
            (g2, skips) = skip2[i]
            skip2[i] = (gcd(g2, a_elem), skips)
        for i in range(len(skip1)):
            (g1, skip) = skip1[i]
            skip2.append((g1, (skip, a_elem)))
        skip2.sort(reverse=True)
        skip2_ = []
        for i in range(len(skip2)):
            admissible = True
            for j in range(i - 1, -1, -1):
                if skip2[j][0] % skip2[i][0] == 0:
                    admissible = False
                    break
            if admissible:
                skip2_.append(skip2[i])
        skip2 = skip2_
