            (g1, skip) = skip1[i]
            skip1[i] = (gcd(g1, a_elem), skip)
        skip1.append((g, a_elem))
        skip1.sort(reverse=True)
        skip1_ = []
        for i in range(len(skip1)):
            admissible = True
            for j in range(i - 1, -1, -1):
                if skip1[j][0] % skip1[i][0] == 0:
                    admissible = False
                    break
            if admissible:
                skip1_.append(skip1[i])
        skip1 = skip1_
        g = gcd(g, a_elem)
